import React from "react";



function Header(){
    return (
        <header className ="header">
            <ul></ul>
              
              <a href="#about-me">About Me</a>
              
              
                    <a href="#work">Work</a>
               
                    <a href="#Contact Me">Contact Me</a>
                
                    <a href="./src/assets/Resume1.pdf">Resume</a>
            />
    </header>
    )
}

export default Header;
